import unittest
from util.http.httpclient import HttpClient

class CancelWayBill(unittest.TestCase):
    def setUp(self):
        self.cancelWayBillApiUrl = 'http://bj.app.yudianbank.com:8080/app/payment/tmsDelWayBill'
        self.token_dict = {
            'token': '',
            'YD_OAUTH' : ''
        }
        self.wayBillId = '123456'
        pass

    def tearDown(self):
        pass

    # '''ddt demo'''
    # from parameterized import parameterized
    # from biz.waybill.mockparamsdata import MockParamsData
    # @parameterized.expand(MockParamsData.generate(1))
    def test_normal_cancel(self):
        try:
            cancel_data_dict = {'billId': self.wayBillId, 'cancleReason': 'CancelByQaPythonTesting'}
            response = HttpClient().post_json(self.cancelWayBillApiUrl, cancel_data_dict, self.token_dict)
            self.assertEqual(response.status_code, 200)
            self.assertEqual(response.json()['code'], 0)
        except Exception:
            self.assertTrue(False)